import React from 'react';
import Link from 'next/link';
import 'antd/dist/antd.css';
import AppLayout from '../components/AppLayout';

const Home = () => {
    return (
        <>
            <AppLayout>
                <Link href="/about"><a>About</a></Link>
                <div>Hello, Next!</div>
            </AppLayout>
        </>
    );
};

export default Home;
